import React from 'react'

const SignImg = () => {
  return (
    <>
    <div className="rightSide mt-5" style={{ width: "100%" }}>
            <div className="SignImg">
              <img src="./hand.jpg" style={{ maxWidth: 580 }} />
            </div>
          </div>
    
    </>
  )
}

export default SignImg
